  input: TEXT,F3A,,"This is a resubmission of the 12-day preliminary report, per request
    of FEC analyst, addressing the concerns raised in his audit. In addition, certain
    other changes have been made to provide greater specificity and closer conformity
    with my understanding of FEC regulations. In the first submission of the report,
    all petty cash disbursements were shown as issued to Anna Peediyakkal, who served
    as the campaign coordinator and who was responsible for all petty cash disbursements.
    In this resubmission all petty cash disbursements have been listed by vendor paid.
    By changing the method of accounting (showing date of disbursements to vendors
    rather than the date of the cash advances to Ms. Peediyakkal), the cash balance
    at the end of the reporting period has changed. The report has also been amended
    to include some small in-kind contributions which supporters did not report until
    well after the primary. . In auditing the first filing I have also discovered
    some posting errors (incorrect dates, mistyped amounts, etc.) which have been
    corrected in this filing. Changes along the same line as outlined are being made
    to the first quarter filing, and an amended filing of that report will be made
    within a week."
